    //  console.log(element)
    //});
    setGroups(allGroups)
    //console.log(groups)
    console.log(groups.size)
    //groups.forEach(content => )
  })
  }, [])

  return (
    <div>
      { groups.size > 0 ? 



        Array.from(groups.entries())
        .forEach(content => {
          <CollapsableSection
            title={content.key}
            content={content.key}
          />
      })
        :

        <p>NO CONTENT</p>
    }
    </div>
  );
};
